
using System.Net;
using System.Net.Http.Json;
using System.Text;
using System.Text.Json;

namespace CleanEjdg.Tests.WebUi.Server.IntegrationTests
{
    public class GetCatTests : IClassFixture<IntegrationTestFactory>
    {
        private readonly IntegrationTestFactory _factory;
        public GetCatTests(IntegrationTestFactory factory)
        {
            _factory = factory;
        }

        private readonly IEnumerable<Cat> TestCats = new List<Cat>()
        {
            new Cat
            {
                Id = 1,
                Name = "Susan",
                DateOfBirth = DateTime.SpecifyKind( new DateTime(2021, 2, 23), DateTimeKind.Utc),
                HasChip = true,
                IsSterilized = true,
                IsVaccinated = true,
                Photos = new List<CatPhoto>()
                {
                    new CatPhoto {
                        Bytes = Encoding.ASCII.GetBytes(""),
                        Description = "F03SgfzWAAkn31E.jpg",
                        FileExtension =  "image/jpeg",
                        Size = 133000,
                        CatId = 1,
                        Id = 1
                    }
                }
            },
            new Cat
            {
                Id = 2,
                Name = "Yuki",
                DateOfBirth =  DateTime.SpecifyKind( new DateTime(2022, 8, 15), DateTimeKind.Utc),
                HasChip = true,
                IsSterilized = true,
                IsVaccinated = false
            }
        };

        [Fact]
        public async void Returns_Succes_When_Cat_Is_Returned()
        {
            // Arrange
            var client = _factory.CreateClient();
            await _factory.SetDbInitialState(TestCats);

            // Act
            var response = await client.GetAsync("api/Cats/1");

            // Assert
            Assert.True(response.IsSuccessStatusCode);
        }

        [Fact]
        public async void Returns_Cat()
        {
            // Arrange
            var client = _factory.CreateClient();
            await _factory.SetDbInitialState(TestCats);

            // Act
            var response = await client.GetAsync("api/Cats/1");

            // Assert
            Cat result = await response.Content.ReadFromJsonAsync<Cat>() ?? new Cat();
            Assert.Equal("Susan", result.Name);
            Assert.Equal("F03SgfzWAAkn31E.jpg", result.Photos.FirstOrDefault(p => p.Id == 1)?.Description);
        }

        [Fact]
        public async void Returns_404NotFound_When_Cat_Is_Not_Found()
        {
            // Arrange
            var client = _factory.CreateClient();
            await _factory.SetDbInitialState(TestCats);

            // Act
            var response = await client.GetAsync("api/Cats/3");

            // Assert
            Assert.True(response.StatusCode == HttpStatusCode.NotFound);
        }
    }
}
